import React from 'react'
import {Ptw} from '../context/PtwContext';

export default function Popup(props) {
  let theUsedContext = React.useContext(Ptw);

  console.log(theUsedContext.ptwState.ptwId)

  let popupValue = <h3>{`this ptw owned by ${theUsedContext.ptwState[theUsedContext.ptwState.ptwId].authorized}`}</h3>

  return (
    <>
      {
        theUsedContext.ptwState.popupShow && popupValue
      }
    </>
  )
}
